import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import homePage from "./container/homepage";

const AppIndex = () => {
  return (
    <>
      <Router>
        <Routes>
          <Route path="/" element={<homePage />} />
        </Routes>
      </Router>
    </>
  );
};

export default AppIndex;
